import { Injectable } from '@angular/core';
import { Router } from '@angular/router';
import { Actions, createEffect, ofType } from '@ngrx/effects';
import { of } from 'rxjs';
import { catchError, exhaustMap, map, tap } from 'rxjs/operators';
import { AuthService } from '../auth.service';
import { loginUser } from '../models/loginUser.model';
import * as AuthActions from '../actions/auth.actions';

@Injectable({
  providedIn: 'root'
})
export class AuthEffects {
  constructor(private actions$: Actions, private authService: AuthService, private router: Router) { }

  //debugging logger, would of course be removed in production
//   logActions$ = createEffect(() =>
//     this.actions$.pipe(
//       tap((action) =>{
//        console.log(action);
//       })
//     ), { dispatch: false });  

  startLogin$ = createEffect(() => this.actions$.pipe(
    // only continue in this observable chain if of the type
    // of the below observable
    ofType(AuthActions.LOGIN_START),
    // grab the signup out and pass it down the observable chain
    map((action) => action.signup),
    //
    exhaustMap((auth: loginUser) =>
      this.authService.login(auth.email, auth.password).pipe(
        // map the response to a new login_success action 
        // map wraps the return value with an observable
        map((response) => {
          const user = this.authService.handleAuthentication(response);
          return AuthActions.LOGIN_SUCCESS({ user });
        }),
        // get any errors and return a login_failure  
        // wrap return value in of() to ensure you return an observable and 
        // don't break the observable chain
        catchError((error) => of(AuthActions.LOGIN_FAILURE({ error: this.authService.handleError(error) })))
      )
    )
  ));

  loginSuccess$ = createEffect(() => this.actions$.pipe(
    ofType(AuthActions.LOGIN_SUCCESS),
    tap(() => this.router.navigate(['/']))
  ), { dispatch: false });

  notLoggedIn$ = createEffect(() => this.actions$.pipe(
    ofType(AuthActions.NOT_LOGGED_IN),
    tap(() => this.router.navigate(['/auth']))
  ), { dispatch: false });  

      

  autoLoginStart$ = createEffect(() => this.actions$.pipe(
    ofType(AuthActions.AUTOLOGIN_START),
    map(() => {
      const loadedUser = this.authService.autoLogin();
      if (loadedUser?.token){
        return AuthActions.AUTOLOGIN_SUCCESS({user: loadedUser})
      } else {
        return AuthActions.LOGOUT();
      }
    })
  ));

}

import { HttpClient, HttpErrorResponse } from '@angular/common/http';
import { Injectable, OnDestroy } from '@angular/core';
import { Router } from '@angular/router';
import { Observable, Subscription } from 'rxjs';
import { User } from 'src/app/models/user.model';
import { environment } from 'src/environments/environment';
import { loginUser } from './models/loginUser.model';
import { loginResult } from './models/loginResult.model';
import * as fromApp from '../store/app.reducer';
import * as AuthActions from './actions/auth.actions';
import * as fromAuth from './reducers';
import { Store } from '@ngrx/store';


@Injectable({
  providedIn: 'root'
})
export class AuthService implements OnDestroy {  
  subscription: Subscription;
  private timer: any = null;  

  constructor(private http: HttpClient, private router: Router, private store: Store<fromApp.State>) {
    this.subscription = this.store.select(fromAuth.selectAuthUser).subscribe((user) => {
      this.clearTimer();
      if (user){
        this.autoLogout(user.expirationMilliseconds);
      }
    });
  }

  ngOnDestroy(): void {}

  login(email: string, password: string) {
    return this.http
      .post<loginResult>(environment.signInURL, new loginUser(email, password)); 
  }

  logout() {  
    localStorage.removeItem('user');
    this.clearTimer() ;
    this.store.dispatch(AuthActions.LOGOUT());
    this.router.navigate(['/auth']);
  }

  clearTimer() {
    if (this.timer) {
      clearTimeout(this.timer);
      this.timer = null;
    }
  }

  autoLogout(exiprationDuration: number) {
    this.timer = setTimeout(() => {
      this.logout();
    }, exiprationDuration);
  }

  autoLogin() {
    const userData = JSON.parse(localStorage.getItem('user'));
    if (!userData) {
      return;
    }
    const loadedUser = new User(userData.email, userData.id, userData._token, new Date(userData._tokenExpirationDate));
    return loadedUser;
  }

  handleAuthentication(res: loginResult) {
    const expirationDate = new Date(new Date().getTime() + +res.expiresIn * 1000);
    const user = new User(res.email, res.localId, res.idToken, expirationDate);
    localStorage.setItem('user', JSON.stringify(user));
    return user;        
  }

  handleError(errorResponse: HttpErrorResponse) {
    let errorMsg = "An error has occurred.";
    switch (errorResponse?.error?.error?.message) {
      case "EMAIL_EXISTS":
        errorMsg = "Email already exists";
        break;
      case "OPERATION_NOT_ALLOWED":
        errorMsg = "Sign in disabled for this project";
        break;
      case "TOO_MANY_ATTEMPTS_TRY_LATER":
        errorMsg = "Too many attempts, try later";
        break;
      case "EMAIL_NOT_FOUND":
        errorMsg = "Email not found"
        break;
      case "INVALID_PASSWORD":
        errorMsg = "Password is invalid"
        break;
      case "USER_DISABLED":
        errorMsg = "User is disabled"
        break;
    }
    return errorMsg;
  }
}

